a:17:{s:4:"name";s:13:"Female Viagra";s:11:"small_descr";s:127:"Female Viagra improves woman's sexuality, increases sensitivity to stimulation, allows to reach an intense sexual satisfaction.";s:14:"small_descr_de";s:113:"Female Viagra hilft, Libido in Frauen zu erhöhen, sexueller Rückruf von Zunahmen, Empfindlichkeit zur Anregung.";s:14:"small_descr_fr";s:127:"Female Viagra améliore sexualité chez les femmes, éleve sensibilité de stimulation, aide obtenir forte satisfaction sexuel.";s:14:"small_descr_es";s:258:"Female Viagra ayuda elevar libido femenino, aumenta llamada sexual, sensibilidad para estimulación, provee culminación múltiple y extraordinario, lubricación perfecta y natural. Trabaja por aumentación de flujo demandado de sangre y plasticidad vaginal.";s:14:"small_descr_it";s:202:"Female Viagra aiuta stimolare libido nelle donne, aumenta richiamo sessuale, sensibilità alla stimolazione, aiuta raggiungere punti culminanti straordinari e moltipli, migliora lubrificazione naturale.";s:10:"full_descr";s:2718:"<p><strong>Common use<br /></strong><br /> Sexual dysfunction in women is characterized by a lack of desire, arousal, or orgasm. Female Viagra helps to boost libido in women, increases sexual recall, sensitivity to stimulation, promotes extraordinary and multiple climaxes, perfect natural lubrication. It acts by increasing the required genital blood flow and vaginal compliance resulting in intensified pleasure during sexual act.<br /><br /> <strong>Dosage and direction<br /></strong><br /> Take it orally, the effect appears in 45 minutes after intake and continues 4-6 hours. Do not exceed the recommended dose to avoid aggravation of side effects. <br /><br /> <strong>Precautions<br /></strong><br /> This medication is effective in women younger than 50 y.o. having a hysterectomy and menopause. Consult your doctor if you are pregnant or breastfeeding before taking Female Viagra.<br /><br /> <strong>Contraindication<br /></strong><br /> Do not take this drug if you are hypersensitive to it. <br /><br /> <strong>Possible side effect<br /></strong><br /> This medication is generally well tolerated but some individuals may experience facial flushing; upset stomach; sensitivity to light; nausea. Seek emergency medical attention immediately if any of the severe side effects occur.<br /><br /> <strong>Drug interaction</strong><br /><br /> Female Viagra was shown to potentate the hypotensive effects of nitrates, and its administration to patients who are using organic nitrates, either regularly and/or intermittently, in any form is therefore contraindicated.<br /><br /> <strong>Missed dose<br /></strong><br /> Take the missed dose as soon as you remember about it. If it is almost time for your next dose just skip it and return to your regular schedule.<br /><br /> <strong>Overdose<br /></strong><br /> Immediate medical attention is needed in case you overdosed the intake of the medicine. <br /><br /> <strong>Storage<br /></strong><br /> Female Viagra should be stored at room temperature, between 36-86 degrees F in a closed container.<br /><br /> <strong>Disclaimer <br /></strong><br /> We provide only general information about medications which does not cover all directions, possible drug integrations, or precautions. Information on the site cannot be used for self-treatment and self-diagnosis. Any specific instructions for a particular patient should be agreed with your health care adviser or doctor in charge of the case. We disclaim reliability of this information and mistakes it could contain. We are not responsible for any direct, indirect, special or other indirect damage as a result of any use of the information on this site and also for consequences of self-treatment.</p>";s:13:"full_descr_de";s:3515:"<p><strong>Allgemeine Anwendung<br /></strong><br /> Die sexuelle Funktionsst&ouml;rung in Frauen wird durch einen Mangel, der Erweckung, oder dem Orgasmus charakterisiert. Female Viagra hilft, Libido in Frauen zu erh&ouml;hen, sexueller R&uuml;ckruf von Zunahmen, Empfindlichkeit zur Anregung, f&ouml;rdert au&szlig;ergew&ouml;hnliche und vielfache H&ouml;hepunkte, vollkommene nat&uuml;rliche Schmierung. Es handelt, den erforderlichen Geschlechtsblutfluss und vaginalen Gehorsam vergr&ouml;&szlig;ernd, der zu verst&auml;rktem Vergn&uuml;gen w&auml;hrend des Koitus f&uuml;hrt.<br /><br /> <strong>Dosierung und Anwendungsgebiet<br /></strong><br /> Nehmen Sie es m&uuml;ndlich, die Wirkung erscheint in 45 Minuten nach der Einnahme und setzt 4-6 Stunden fort. &Uuml;berschreiten Sie die empfohlene Dosis nicht, um Erschwerung von Nebenwirkungen zu vermeiden.<br /><br /> <strong>Vorsichtsma&szlig;nahmen<br /></strong><br /> Dieses Medikament ist in Frauen wirksam, die j&uuml;nger sind als 50 y.o. eine Hysterektomie und Klimakterium zu haben. Befragen Sie Ihren Arzt, wenn Sie schwanger sind oder Stillen vorher, um das Viagra f&uuml;r die Frauen zu nehmen.<br /><br /> <strong>Kontraindikationen<br /></strong><br /> Nehmen Sie dieses Medikament nicht, wenn Sie dazu &uuml;berempfindlich sind.<br /><br /> <strong>M&ouml;gliche Nebenwirkungen<br /></strong><br /> Dieses Medikament wird allgemein gut geduldet, aber einige Personen k&ouml;nnen Gesichtssp&uuml;lung erfahren; Magenschmerzen; Empfindlichkeit, um sich zu entz&uuml;nden; Brechreiz. Suchen Sie Notarztaufmerksamkeit sofort, wenn einige von schweren Nebenwirkungen vorkommt.<br /><br /> <strong>Wechselwirkung</strong><br /><br /> Female Viagra wurde zu potentiate die Hypotensive-Effekten von Nitraten gezeigt, und seine Verabreichung Patienten gezeigt, die organische Nitrate verwenden, irgendein regelm&auml;&szlig;ig und/oder periodisch auftretend, in jeder Form wird deshalb kontraindiziert.<br /><br /> <strong>Verpasste Dosis<br /></strong><br /> Nehmen Sie die verpasste Dosis, sobald Sie sich dar&uuml;ber erinnern. Wenn es fast Zeit Ihrer folgenden Dosis ist, gerade lassen es aus und kehren zu Ihrer regelm&auml;&szlig;igen Liste zur&uuml;ck.<br /><br /><strong> &Uuml;berdosierung</strong><br /><br /> Unmittelbare medizinische Aufmerksamkeit ist erforderlich, im Falle dass Sie die Medizin &uuml;berdosierten.<br /><br /> <strong>Lagerung<br /></strong><br /> Female Viagra sollte bei der Raumtemperatur, zwischen 36-86 Graden F in einem geschlossenen Beh&auml;lter gelagert werden.<br /><br /> <strong>Haftung<br /></strong><br /> Wir stellen Ihnen nur die allgemeine Information &uuml;ber die Medizin zur Verf&uuml;gung vor, die nicht alle Anweisungen, m&ouml;glichen Wechselwirkungen oder Vorsichtma&szlig;nahmen umfasst. Die Information, die auf dieser Seite ausgestellt ist kann nicht f&uuml;r die Selbstbehandlung oder f&uuml;r die Eigendiagnostik verwendet werden. Alle Anweisungen f&uuml;r einen bestimmten Patienten sollen mit Ihrem Gesundheitspflegeberater oder Doktor, der f&uuml;r den Fall verantwortlich ist, &uuml;bereingestimmt werden. <br /><br /> Wir m&uuml;ssen jede Haftung f&uuml;r Sch&auml;den ablehnen, die aus einer missbr&auml;uchlichen Nutzung von den Informationen auf dieser Seite entstehen kann.<br /> Wir sind nicht f&uuml;r direkte, indirekte, spezielle oder andere indirekte Besch&auml;digung irgendwelcher Art, sowie auch f&uuml;r Folgen Ihrer m&ouml;glichen Selbstbehandlung nicht verantwortlich.</p>";s:13:"full_descr_fr";s:3580:"<p><strong>Usage g&eacute;n&eacute;ral</strong><br /><br /> Dysfonction sexuel chez les femmes est caract&eacute;ris&eacute; par d&eacute;ficience de d&eacute;sir, &eacute;tat d'excitation ou orgasme. <br /> Female Viagra aide &eacute;lever libido chez les femmes, &eacute;lever rappel sexuel, sensibilit&eacute; pour agitation, ceux m&eacute;dicament monte des climat&egrave;res multiples et extraordinaire, grand lubrifiage naturel. Le m&eacute;dicament est en fonction par flux sangine g&eacute;nital et compliance vaginal que amener &agrave; plasir intensifi&eacute; pendant acte sexuel. <br /><br /> <strong>Dosage et administration<br /></strong><br /> Prenez-la per os, effet se produit dans les 45 minutes apr&eacute;s absorption et dure 4-6 heures. Ne prenez pas plus pout &eacute;vter des Effets secondaires possibles.<br /><br /> <strong>Pr&eacute;cautions<br /></strong><br /> Ceux m&eacute;dicament est effectif pour les femmes de moins de 50 ans qu'ont hysterectomy et m&eacute;nopause. Consultez &agrave; votre docteur si vous &ecirc;tes grossesse or nourrice apr&eacute;s prener Female Viagra.<br /><br /> <strong>Contre-indications</strong><br /><br /> Ne prenez pas ceux m&eacute;dicament si vous avez hypersensibilit&eacute; de la.<br /><br /> <strong>Possible Effets secondaires possibles</strong><br /><br /> Ceux m&eacute;dicament est en g&eacute;neral bien souffrant mais des individus peuvent sentir hyper&eacute;mie du faci&egrave;s, doleur dental, torpidit&eacute;, sensibilit&eacute; de lumi&egrave;re. Equisitionnez &agrave; secours d'urgence si vous sentez les Effets secondaires possibles.<br /><br /> <strong>Interaction des medicaments<br /></strong><br /> Female Viagra est contre-indiqu&eacute; pour patients qui prennent des nitrates organiques r&eacute;guli&egrave;rement et/ou irr&eacute;guli&egrave;rement puisque ceux m&eacute;dicament donne de la vitalit&eacute; aux effets hypotensif des nitrates. <br /><br /> <strong>Omission de dose</strong><br /><br /> Si vous manquez le dose de medicament, prenez-la d&egrave;s que vous vous rappellerez mais ne prenez pas si c'est presque le temp de prenez chez vos calendrier.<br /><br /> <strong>Surdosage<br /></strong><br /> Si vous tenez en suspicion que vous prenez trop de medicament, vous devez r&eacute;quisitionner &agrave; secours d'urgence.<br /><br /> <strong>Conservation</strong><br /><br /> Female Viagra doit conserver au sec prot&eacute;ge de lumi&egrave;re &agrave; la temp&eacute;rature ambiante entre 15-30 C (59-86 F).<br /><br /> <strong>Disclaimer (avis de non responsabilit&eacute;)<br /></strong><br /> Nous fournissons des renseignements &agrave; caract&egrave;res uniquement g&eacute;n&eacute;raux sur les m&eacute;dicaments qui ne n&rsquo;englobent pas tous les domaines, les polyvalences possibles du m&eacute;dicament, ou les pr&eacute;cautions. Les renseignements sur le site ne peuvent &ecirc;tre utilis&eacute;s pour un traitement personnel et un diagnostic personnel. Toute instruction sp&eacute;cifique pour un patient particulier devrait &ecirc;tre consult&eacute;e avec votre conseiller de soins de sant&eacute; ou votre m&eacute;decin responsable du cas. Nous refusons toute r&eacute;f&eacute;rence au caract&egrave;re ind&eacute;niable de ces renseignements et des erreurs qu'ils pourraient contenir. Nous ne sommes pas responsables de tout dommage direct ou indirect, sp&eacute;cial ou d&rsquo;autre dommage &agrave; la suite de toute utilisation des renseignements sur ce site et &eacute;galement pour les cons&eacute;quences de l&rsquo;auto-traitement.</p>";s:13:"full_descr_es";s:3353:"<p><strong>Propiedades</strong><br /><br /> Disfunci&oacute;n sexual que pueden tener mujeras se caracteriza por falta de deseo, agitaci&oacute;n o orgasmo. Female Viagra ayuda elevar libido femenino, aumenta llamada sexual, sensibilidad para estimulaci&oacute;n, provee culminaci&oacute;n m&uacute;ltiple y extraordinario, lubricaci&oacute;n perfecta y natural. Trabaja por aumentaci&oacute;n de flujo demandado de sangre y plasticidad vaginal. Este resulta a placer intenso durante acto sexual.<br /><br /> <strong>Posolog&iacute;a y forma de administraci&oacute;n<br /></strong><br /> Tome la medicina adentro, el efecto aparece dentro de 45 minutos despu&eacute;s de toma, y continua 4-6 horas. No se puede excededer la dosis recomendada para evitar complicaci&oacute;n de efectos secundarios.<br /><br /> <strong>Precauciones<br /></strong><br /> Esta medicina es efectiva para las mujeras, que no tiene 50 a&ntilde;os, teniendo histerectom&iacute;a o menopausa. Consulte a su m&eacute;dico si usted est&aacute; emborazada o amamantando antes de tomar Female Viagra.<br /><br /> <strong>Contradiciones<br /></strong><br /> No se puede tomar esta medicina si usted tiene sensibilidad excesiva a ella.<br /><br /><strong>Reccionas adversas posibles<br /></strong><br /> Esta medicina es muy tolerante a la mayor&iacute;a de los pacientes, pero algunos pacientes pueden sentir rubefacci&oacute;n de cara, descomposici&oacute;n, sensibilidad a luces, n&aacute;usea. Busque ayda medical urgente inmediatamente si alg&uacute;n de efectos secundarios ocurre.<br /><br /> <strong>Interacci&oacute;n con otros medicamentos</strong><br /><br /> Female Viagra fue llamada para elevar a una potencia efectos hippotensivos de nitratos, y su prescripci&oacute;n a los pacientes que usan nitratos organicos regurlamente y no es contradicada en todas las formas.<br /><br /> <strong>Dosis omitida <br /></strong><br /> Tome la dosis omitida m&aacute;s pronto como posible. Si es casi la hora para tomar la dosis siguiente, omitala y vuelva a su horatio.<br /><br /> <strong>Sobredosis<br /></strong><br /> Ayuda medica urgente se necesita si Usted ha tomado mucho de la medicina.<br /><br /> <strong>Almacenamiento<br /></strong><br /> Se debe almacenar Female Viagra a una temperatura de 36-86 grados en un container cerrado.<br /><br /> <strong>Descargo de responsabilidades<br /></strong><br /> Proveemos una informaci&oacute;n del car&aacute;cter general sobre los medicamentos sin intentar cubrir todas las recomendaciones, totalidad de los casos de interacci&oacute;n con otros medicamentos, tampoco todas las precauciones existentes. La informaci&oacute;n de la presente p&aacute;gina web no puede ser de utilidad en el autotratamiento ni el autodiagn&oacute;stico. Todas las recomendaciones espec&iacute;ficas para cada paciente individual deben arreglarse con el coordinador designado de la salud p&uacute;blica o con el m&eacute;dico encargado del caso cl&iacute;nico. Renunciamos de todas las responsabilidades por la fiabilidad del material provisto ni por errores que contenga. Nos descargamos de responsabilidad por los da&ntilde;os, sean que sean directos, indirectos, espec&iacute;ficos o dem&aacute;s da&ntilde;os que resulten de la aplicaci&oacute;n del contenido de la presente p&aacute;gina web ni que sean consecuencias del autotratamiento</p>";s:13:"full_descr_it";s:3174:"<p><strong>Uso commune<br /></strong><br /> Disfunzione sessuale nelle donne viene caratterizzato dlla mancanza di desiderio, eccittazione o orgasmo. Female Viagra aiuta stimolare libido nelle donne, aumenta richiamo sessuale, sensibilit&agrave; alla stimolazione, aiuta raggiungere punti culminanti straordinari e moltipli, migliora lubrificazione naturale. Agisce aumentando la circolazione di sangue negli organi genitali ed elasticit&agrave; vaginale. Il risultato di questa azione &egrave; intensificazione di piacere durante il coito. <br /><br /> <strong>Dosaggio e direzioni</strong><br /><br /> Il farmaco viene preso per via orale. L&rsquo;effetto avviene entro 45 minuti e dura 4-6 ore. Non superate la dose prescritta per evitare aggravamento degli Eventuali effetti collaterali. <br /><br /> <strong>Precauzioni<br /></strong><br /> Il farmaco &egrave; efficace nelle donne minori di 50 anni quali hanno isterectomia e sono nel periodo di menopausa. Le donne encinte o allattante devono consultare il medico prima di prendere Female Viagra. <br /><br /> <strong>Contraindicazioni<br /></strong><br /> Non prendete il farmaco se siete ipersensibi al farmaco stesso o ai suoi componenti. <br /><br /> <strong>Eventuali effetti collaterali<br /></strong><br /> Il farmaco &egrave; di solito ben tolerato ma alcuni individui possono sperimentare arrosamento del viso, disturbo gastrico, fotosensibilit&agrave;, nausea. Cercate assistenza medica immediata se sperimentate gravi effetti collaterali. <br /><br /> <strong>Interazione medicinale<br /></strong><br /> Female Viagra ha dimostrato la capacit&agrave; di intensificare l&rsquo;effetto ipotensivo di nitrati. Percio &egrave; contraindicato prescrivere il farmaco ai pazienti quali prendono tutte le forme di nitrati organici regolarmante e/o periodicamente.<br /><br /> <strong>Dose saltata<br /></strong><br /> Se avete dimenticato di prendere la dose dovete prenderla appena ricordate. Se siete vicini al tempo di prendere la dose successiva, lasciate perdere la dose saltata e prendete la dose successiva nel tempo regolare. <br /><br /> <strong>Overdose<br /></strong><br /> Nel caso di overdose cercate assistenza medica immediata. <br /><br /> <strong>Preservazione<br /></strong><br /> Mantenete Female Viagra alla temperatura ambiente di 36-86oF nel contenitore ben chiuso.<br /><br /> <strong>Declinazione della responsabilit&agrave;<br /></strong><br /> Noi provvediamo soltanto l&rsquo;informazione generale del farmaco descritto. Questa informazione non copre tutte le indicazioni, eventuali interazioni medicinali o precauzioni. Informazione presentata su questo sito web non pu&ograve; essere usata per autoterapia e autodiagnostica. Qualsiasi indicazione specifica per un paziente determinato deve essere concordata con il suo consulente o medico curante responsabile per il suo caso. Noi decliniamo la responsabilit&agrave; di questa informazione ed eventuali errori quali pu&ograve; contenere. Non siamo responsabili di ogni danno diretto, indiretto o speciale o altri danni indiretti causati por uso di informazione su questo sito web ed anche per le conseguenze dell&rsquo;autoterapia.</p>";s:9:"min_price";s:7:"0.68385";s:9:"pack_name";s:5:"pills";s:4:"type";s:2:"mg";s:7:"analogs";a:45:{s:6:"Viagra";s:20:"Erectile Dysfunction";s:12:"Brand Viagra";s:20:"Erectile Dysfunction";s:19:"Viagra Professional";s:20:"Erectile Dysfunction";s:19:"Viagra Super Active";s:20:"Erectile Dysfunction";s:18:"Extra Super Viagra";s:20:"Erectile Dysfunction";s:11:"Viagra Soft";s:20:"Erectile Dysfunction";s:7:"Kamagra";s:20:"Erectile Dysfunction";s:8:"Sildalis";s:12:"Men's Health";s:8:"Silvitra";s:20:"Erectil